import React, { Component } from "react";
import Header from "./Header";
import Footer from "./Footer";
import Meta from "./Meta";
export default class Page extends Component {
  render() {
    return (
      <div>
        <Meta />
        <main class="content">
          <Header />
          {this.props.children}
          <Footer />
        </main>
      </div>
    );
  }
}
